import React from 'react'
import NavBar from '../navbar/NavBar'
import Infobox from '../infobox/InfoboxContainer'

class HomeContainer extends React.Component {

    constructor(props) {
        super(props)
        this.state = {
            plans: []
        }
    }

    componentDidMount() {
        fetch('localhost:5000/plans/all')
            .then(results => results.json())
            .then(plans => {
                this.setState({
                    plans: plans
                })
                console.log('test')
            })
    }

    getAllPlans(type) {
        return  <Infobox type={type}/>
    }

    render() {
        return (
            <>
            <NavBar />
            <div class="container">
                <div class="row">
                    <div class="col-md-8">{this.getAllPlans("healthcare.jpg", "Health Care", )}</div>
                </div>
            </div>
            </>
        )
    }
}

export default HomeContainer
